                node.Parent().RemoveChild(node);
            }

            node.Parent(this);
        }

        _identifier_ = node;
    }
    public TNewline GetNewline ()
    {
        return _newline_;
    }

    public void SetNewline (TNewline node)
    {
        if(_newline_ != null)
        {
            _newline_.Parent(null);
        }

        if(node != null)
        {
            if(node.Parent() != null)
            {
                node.Parent().RemoveChild(node);
            }

            node.Parent(this);
        }

        _newline_ = node;
    }

    public override string ToString()
    {
        return ""
            + ToString (_keyword_using_)
            + ToString (_identifier_)
            + ToString (_newline_)
        ;
    }

    internal override void RemoveChild(Node child)
    {
        if ( _keyword_using_ == child )
        {
            _keyword_using_ = null;
            return;
        }
        if ( _identifier_ == child )
        {
            _identifier_ = null;
            return;
        }
        if ( _newline_ == child )
        {
            _newline_ = null;
            return;
        }
    }

    internal override void ReplaceChild(Node oldChild, Node newChild)
    {
        if ( _keyword_using_ == oldChild )
        {
            SetKeywordUsing ((TKeywordUsing) newChild);
            return;
        }
        if ( _identifier_ == oldChild )
        {
            SetIdentifier ((TIdentifier) newChild);
            return;
        }
        if ( _newline_ == oldChild )
        {
            SetNewline ((TNewline) newChild);
            return;
        }
    }

}

public sealed class Start : Node
{
    private PDocument _base_;
    private EOF _eof_;

    public Start()
    {
    }

    public Start(
        PDocument _base_,
        EOF _eof_)
    {
        SetPDocument(_base_);
        SetEOF(_eof_);
    }

    public override Object Clone()
    {
        return new Start(
            (PDocument) CloneNode(_base_),
            (EOF) CloneNode(_eof_));
    }

    public override void Apply(Switch sw)
    {
        ((Analysis) sw).CaseStart(this);
    }

    public PDocument GetPDocument()
    {
        return _base_;
    }
    public void SetPDocument(PDocument node)
    {
        if(_base_ != null)
        {
            _base_.Parent(null);
        }

        if(node != null)
        {
            if(node.Parent() != null)
            {
                node.Parent().RemoveChild(node);
            }

            node.Parent(this);
        }

        _base_ = node;
    }

    public EOF GetEOF()
    {
        return _eof_;
    }
    public void SetEOF(EOF node)
    {
        if(_eof_ != null)
        {
            _eof_.Parent(null);
        }

        if(node != null)
        {
            if(node.Parent() != null)
            {
                node.Parent().RemoveChild(node);
            }

            node.Parent(this);
        }

        _eof_ = node;
    }

    internal override void RemoveChild(Node child)
    {
        if(_base_ == child)
        {
            _base_ = null;
            return;
        }

        if(_eof_ == child)
        {
            _eof_ = null;
            return;
        }
    }
    internal override void ReplaceChild(Node oldChild, Node newChild)
    {
        if(_base_ == oldChild)
        {
            SetPDocument((PDocument) newChild);
            return;
        }

        if(_eof_ == oldChild)
        {
            SetEOF((EOF) newChild);
            return;
        }
    }

    public override string ToString()
    {
        return "" +
            ToString(_base_) +
            ToString(_eof_);
    }
}
